        e.preventDefault()
    }
    return (
        <div className={styles.form}>
            <form
                onSubmit={submitFormHandler}>
                <div className={styles.input}>
                    <input
                        onChange={searchChangeHandler}
                        ref={inputRef}
                        placeholder="Search news..."
                        type='search' />
                    <button>Submit</button>
                </div>
            </form>
        </div>
    )
}
